entity13378n.addComponent(new NFTdata(entity13378n, "0xbace7e22f06554339911a03b8e0ae28203da9598", "1996", "Homestead Fork", "Cryptoarte - Early Days-theDAO", "The Homestead update, released on Pi Day (March 14th, 2016) at block 1,150,000, is widely considered the first stable Ethereum release. Initially planned to deploy a month after Frontier, it actually took the developers 7.5 months to complete the extensive project.Ethereum forks include a number of Ethereum Improvement Proposals (EIP). Homestead implemented 3 EIPs (EIP-2, 7 and 8). These EIPs cover a broad number of improvements, including an increase to the cost of contract creation to address a protocol bug which allowed value transfer at 11664 gas, the introduction of the DELEGATECALL opcode which enabled safer smart contract design pattern such as proxy contracts, and changes to the difficulty calculation, in hope of restoring an average block time of 15 seconds (which had recently averaged about 1 block per 13 seconds).", "", "More info")) 
