entity15410n.addComponent(new NFTdata(entity15410n, "0xbace7e22f06554339911a03b8e0ae28203da9598", "4644", "Spurious Dragon", "Cryptoarte - Denial of Service", "On November 22nd, 2016, the Ethereum network underwent the Spurious Dragon hard fork at block 2,675,000. It was the second hard fork in response to the DoS attacks. In particular, the Suicide bomb attacks had created nearly 20,000,000 empty accounts which cluttered the state trie (where information on account balances and storage is kept). The purpose of this second hard fork was to allow these empty accounts to be deleted and ignored by clients.Spurious Dragon implemented EIP-158. In particular, any account with nonce of 0, balance of 0, no code or storage would be deleted whenever that account would be touched (such as when a no-value transaction would be sent to it). Over the course of the week following the fork, the 20 million empty accounts were all touched this way, which allowed the state trie to reduce significantly in size.On November 29th, 2016, Vitalik announced on Twitter State clearing 100% complete.", "", "More info")) 
